import React from 'react'
import {button} from 'react-dom'

const NotesLoginPage = () => {
  return (
    <div>
        <form>
            <input type="email" placeholder="Email"></input>
            <input type="password" placeholder="Password"></input>
        </form>
    </div>
  )
}

export default NotesLoginPage
